def find_the_difference(s, t):
    # Check if s is not empty or is a word
    if len(s) == 0:
        return t
    
    sorted_s = sorted(s)
    sorted_t = sorted(t)
    
    added_value = ''
    # loop through s and find the all the available values
    for i in range(len(t) - 1):
        if sorted_s[i] != sorted_t[i]:
            print(sorted_t[i])
            added_value = sorted_t[i]
            break
    if added_value == "":
        return sorted_t[len(s): ][0]
    return added_value
    

if __name__ == "__main__":
    a = ""
    
    b = ""
    
    print(find_the_difference(a, b))
    print(find_the_difference('abcd', 'abcde'))